import axios from 'axios';
import React, { useState } from 'react'

const Register = () => {

    const [inputs, setInputs] = useState({});


    const handleChange = (e) => {
        const name = e.target.name;
        const value = e.target.value;
        setInputs(values => ({...values, [name]: value}))
    }

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(inputs);

        axios.post('http://localhost:8888/api/addUser', inputs)
        .then(function(response){
            console.log(response);
        });
    }


  return (
    <div>
        <h1>Sign Up to FakeBook</h1>
        <p>Give us all that sweet sweet data!</p>
        <form>
            <div className='names'>
                <input name="first" type="text" placeholder='First Name'/>
                <input name='last' type="text" placeholder='Last Name'/>
            </div>
            <input name="email" type="email" placeholder='Your Email'/>
            <div className='userCon'>
                <input name="username" type="username" placeholder='Select A Username'/>
                <input name="contact" type="contact" placeholder='Contact Number'/>
            </div>
            <div className='passCon'>
                <input name="password" type="username" placeholder='Choose A Password'/>
                <input type="password" placeholder='Confirm Password'/>
            </div>
            <button type="submit">Take my Data Lizard Man!</button>
        </form>

    </div>
  )
}

export default Register
